import React from "react";
import "./Manager.css"; // Import your CSS file for styling

function Manager() {
  return (
    <div>
      {/* Navbar */}
      <div className="navbar">
        <img src="your-logo.png" alt="Logo" className="logo" />
      </div>

      {/* Sidebar */}
      <div className="sidebar">
        <ul>
          <li>Home</li>
          <li>Services</li>
          <li>Options</li>
          <li>About Us</li>
          <li>Contact Us</li>
        </ul>
      </div>
    </div>
  );
}

export default Manager;
